import React, { Component } from "react";
import { Link } from "react-router-dom";
import SideNavigation from "./SideNavigation";

class HeaderLeft extends Component {
  constructor(props) {
    super(props);
    this.state = {
      toggleNav: true,
    };
  }

  onToggleNav = () => {
    console.log("Da click");
  };

  render() {
    var { toggleNav } = this.state;
    return (
      <div className="col header-left p-0">
        <SideNavigation toggleNav={toggleNav} />
        <ul className="nav menu align-items-center">
          <li className="nav-item">
            <button className="btn shadow-none far fa-bars size-18"></button>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin/users">
              Users
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Settings
            </Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default HeaderLeft;
